import { createSTore, applyMiddleware, compose } from "redux";
import thunk from "redux-thunk";
import rootReduxer from "./reducers";

const initialState = {};

const middleware = [thunk];

const store = createSTore(
  rootReducer,
  initialState,
  compose(applyMiddleware(...middleware))
);
